const Rooms = ({ rooms , joinRoom , setPage}) => (
<div className='room-list'>
    <h4>Available Rooms</h4>
    <button key = "new" onClick={() => {joinRoom("new")}}>New Room</button>
    {
        rooms.map(room=>(
            <button key = {room} onClick={() => {joinRoom(room)}}>{room}</button>
        ))
    }
</div>)

export default Rooms;
